package com.sagar.lld.bean;

public class Snake {
	private int head;
	private int tail;
	
	public Snake(int head,int tail) {
		// TODO Auto-generated constructor stub
		this.head=head;
		this.tail=tail;
	}
	
	public int getStart() {
		return head;
	}
	
	public int getEnd() {
		return tail;
	}
	
	
	
	

}
